    //   setSnackBar({
    //     value: true,
    //     message: 'User Logged In Successfully',
    //     type: 'green',
    //   })
    //   setLoading(false)
    // }
    // else {
    //   setSnackBar({ value: true, message: userData.message, type: 'red' })
    //   setLoading(false)
    // }
  }

  if (location.verified) {
    setSnackBar(location.verified)
  }
